্যাথা করেছেন সেই চিত্রটিতে একটি X আঁকুন।\r\nযদি ব্যথা চলে তাহলে চিত্রের উপর একটি O আঁকুন যেখানে ব্যথা চলে।\r\nআপনার রক্তপাত হলে যে চিত্রে আপনি রক্তপাত করছেন সেখানে একটি + আঁকুন।','إذا كنت تتألم ، ارسم علامة X على الشكل حيث تؤلمك.\r\nإذا تحرك الألم ، ارسم حرف O على الشكل الذي يتحرك فيه الألم.\r\nإذا كنت تنزف ، ارسم علامة + على الشكل الذي تنزف منه.','如果你伤害在你伤害的图上画一个X.\r\n如果疼痛移动，疼痛移动的O\r\n如果你出血在你出血的地方画一个+','If you are hurting draw a X on thefigure where you hurt.\r\nIf the pain moves draw a O on thefigure where the pain moves.\r\nIf you are bleeding draw a +on the figure where you are bleeding.','Si vous blessez dessiné un X sur la figure où vous blesser.\r\nSi la douleur se déplace, dessinez un O sur la figure où se déplace la douleur.\r\nSi vous saignez, dessinez a + sur la figure où vous saignez','Wenn Sie verletzt sind ein X auf die Figur\r\ngezogen, wo Sie verletzt.\r\nWenn die Schmerzen ziehen ein O auf die\r\nFigur, wo die Schmerzen bewegt.\r\nWenn Sie bluten, ziehen Sie ein + auf die Figur, wo Sie bluten.','Εάν είστε πληγώνει που ένα Χ στο σχήμα, όπου σας βλάψει.\r\nΕάν ο πόνος κινήσεις σχεδιάσετε ένα\r\nO στο σχήμα όπου ο πόνος κινήσεις.\r\nΕάν η αιμορραγία σχεδιάσετε ένα +\r\nστο σχήμα, όπου θα έχετε την\r\nαιμορραγία.','તમે આકૃમિતજ્યાંતમે નુકસાન પરએ&સદોરવામાંઅસર  કરવામાંઆવે છે.\r\nપીડાચાલઆંકડોજ્યાંપીડા ચાલપરએકઓડ્રો.\r\nતમે આકૃમિતજ્યાંતમે ર&ત)ત્રાવથાય છે તેનાપર એક +    ડ્રોર&ત)ત્રાવથાય છે','आप आंकड़ा (हां तुम्हें चोट लगी है पर एक ए\'स तैयार की चोट पहुँचा रहे हैं।\r\nदद0 चाल आंकड़ा (हां दद0 चाल पर एक हे आकलिष0त करते हैं।\r\nआप आंकड़ा (हां आप खून बह रहा है पर एक + आकलिष0त खून बह रहे हैं।','Se si sta male disegnato una X sulla figura dove ti fa male.\r\nSe si muove il dolore disegnare una O\r\nsulla figura in cui il dolore si muove.\r\nSe si sta sanguinando disegnare un +\r\nsulla figura dove si sta sanguinando.','あなたが傷ついている姿にXを描い\r\nているのを傷つけている場合。\r\n痛みが動いたら、痛みが動く姿にO\r\nを描きます。\r\nあなたが出血している場合は、出血\r\nしている図の上に+を描きます。','상처를 입으면그림에 X를그린다. 통증이 움직이는경우그림에 O 가표시되어 통증이움